// n8n Code node

function expandYear(year) {
  if (isNaN(year)) return NaN;
  if (year < 100) {
    // Pivot rule:
    // 00–49 => 2000–2049
    // 50–99 => 1950–1999
    return year >= 50 ? 1900 + year : 2000 + year;
  }
  return year;
}

function isValidDate(y, m, d) {
  if (!y || !m || !d) return false;
  const date = new Date(y, m - 1, d);
  return (
    date.getFullYear() === y &&
    date.getMonth() === m - 1 &&
    date.getDate() === d
  );
}

function normalizeDate(dateStr) {
  if (!dateStr) return '';

  let cleaned = String(dateStr).trim();
  if (!cleaned) return '';

  // 1) Remove ISO-style time: 2023-02-28T10:30:00Z -> 2023-02-28
  cleaned = cleaned.replace(/T.*$/, '');

  // 2) Remove trailing time part if present
  cleaned = cleaned.replace(/\s+\d{1,2}:\d{2}(:\d{2})?\s*(AM|PM|am|pm)?$/, '');

  cleaned = cleaned.trim();
  if (!cleaned) return '';

  // Month names → let JS parse (e.g. "21 MAR 2023")
  if (/[a-zA-Z]/.test(cleaned)) {
    const d = new Date(cleaned);
    if (!isNaN(d.getTime())) {
      const dd = String(d.getDate()).padStart(2, '0');
      const mm = String(d.getMonth() + 1).padStart(2, '0');
      const yyyy = String(d.getFullYear());
      return `${dd}/${mm}/${yyyy}`;
    }
    return cleaned;
  }

  // Normal numeric separators: / - .
  const parts = cleaned.split(/[\/\-\.]/).map(p => p.trim());
  if (parts.length !== 3) {
    const d = new Date(cleaned);
    if (!isNaN(d.getTime())) {
      const dd = String(d.getDate()).padStart(2, '0');
      const mm = String(d.getMonth() + 1).padStart(2, '0');
      const yyyy = String(d.getFullYear());
      return `${dd}/${mm}/${yyyy}`;
    }
    return cleaned;
  }

  let [p1, p2, p3] = parts.map(p => parseInt(p, 10));

  // Case 1: YYYY-MM-DD
  if (parts[0].length === 4 && !isNaN(p1) && !isNaN(p2) && !isNaN(p3)) {
    const y = p1;
    const m = p2;
    const d = p3;
    if (isValidDate(y, m, d)) {
      const dd = String(d).padStart(2, '0');
      const mm = String(m).padStart(2, '0');
      const yyyy = String(y);
      return `${dd}/${mm}/${yyyy}`;
    }
  }

  // Case 2: DD/MM/YYYY or MM/DD/YYYY (last part is year)
  if (!isNaN(p1) && !isNaN(p2) && !isNaN(p3)) {
    let year = expandYear(p3);

    // Prefer DD/MM for ambiguity
    let y = year;
    let m = p2;
    let d = p1;
    if (isValidDate(y, m, d)) {
      const dd = String(d).padStart(2, '0');
      const mm = String(m).padStart(2, '0');
      const yyyy = String(y);
      return `${dd}/${mm}/${yyyy}`;
    }

    // Fallback: MM/DD
    m = p1;
    d = p2;
    if (isValidDate(y, m, d)) {
      const dd = String(d).padStart(2, '0');
      const mm = String(m).padStart(2, '0');
      const yyyy = String(y);
      return `${dd}/${mm}/${yyyy}`;
    }
  }

  const d = new Date(dateStr);
  if (!isNaN(d.getTime())) {
    const dd = String(d.getDate()).padStart(2, '0');
    const mm = String(d.getMonth() + 1).padStart(2, '0');
    const yyyy = String(d.getFullYear());
    return `${dd}/${mm}/${yyyy}`;
  }

  return cleaned;
}

// Helper to support both old & new shapes:
// - "White Lotus"
// - { description: "White Lotus" }
// - { value: "White Lotus" }
function extractField(field) {
  if (field == null) return '';
  if (typeof field === 'string') return field;
  if (typeof field === 'object') {
    if (typeof field.description === 'string') return field.description;
    if (typeof field.value === 'string') return field.value;
  }
  return String(field);
}

return items.map(item => {
  const out = item.json.output || item.json;

  const vendor   = extractField(out.vendor);
  const cost     = extractField(out.cost);
  const tax      = extractField(out.Tax);
  const dateRaw  = extractField(out.date);
  const currency = extractField(out.currency);
  const abn      = extractField(out.ABN);

  const normalizedDate = normalizeDate(dateRaw);

  return {
    json: {
      vendor,
      cost,
      Tax: tax,
      date: normalizedDate,
      currency,
      ABN: abn,
    },
  };
});

return items.map(item => {
  const cost = parseFloat(item.json.cost);

  if (!isNaN(cost)) {
    // Calculate tax as cost / 11
    item.json.Tax = (cost / 11).toFixed(2);
  }

  // vendor, cost, date, currency stay exactly the same
  return item;
});
